import React from 'react';

const CollectionPreview = ({ title, items }) => {
  const renderedPreviewItem = items.map((item) => {
    return <div>item.name</div>;
  });
  return (
    <div>
      <h1>{title}</h1>
      <div>{renderedPreviewItem}</div>
    </div>
  );
};

export default CollectionPreview;
